# Find the Difference
# You are given two strings s and t.
# String t is generated by random shuffling string s and then add one more letter at a random position.
# Return the letter that was added to t.

# s = "abcd"
# t = "abcde"

# s = ""
# t = "y"

# s = "a"
# t = "aa"

s = ""
t = ""

m1 = {}
for i in s:
    if i not in m1:
        m1[i] = 1
    else:
        m1[i] += 1

for i in t:
    if i not in m1:
        m1[i] = 1
    else:
        m1[i] += 1


for key, value in m1.items():
    if value % 2 != 0:
        print(key)


